import { AppBar, Toolbar, styled, Box } from '@mui/material';


// components 
import LoginDialog from "./account/LoginDialog";

const Component = styled(Box)`
height : 100vh;
background: #DCDCDC;
`





const Header = styled(AppBar)`
    height: 220px;
    background-color: #00bfa5;
    box-shadow : none;
`
const Messenger = () => {
    return (
        <>
            <Box>
                <Header>
                    <Toolbar>

                    </Toolbar>
                </Header>

                <LoginDialog />

            </Box>


        </>


    )
}

export default Messenger;
